import React, { Component } from 'react'
import axios from 'axios'

class Cities extends Component {
    constructor(props) {
        super(props);

        this.state = {
            cities: [],
        }
    }
    componentDidMount(){
        fetch('/cities/all')
        .then(results => {
            return results.json();
        })

        this.setState({
            cities: {results}
        })
    }
    render() {
        return (
            <div>

            </div>
        )
    }
}

export default Cities;
